html {height:100%;}
body {height:100%; min-height:100%;}
header {display:table-row;/*position:absolute; */height:5.625em;width:94%;}
/*header:after { visibility: hidden; display: block; content: ""; clear: both; height: 0; }*/
.logo-link {position: relative; z-index: 1;float:left;}
.logo { padding: 20px 0 0; width: 234px; }
.main {display:table;height:100%;}
.main, footer {width: 95%;max-width: 1200px; padding:0 1.5em; margin-left: auto; margin-right: auto;}
footer {height:3em; margin-top:-3em; overflow: hidden}
.section {text-align: center; line-height: 1em; height:100%; display:table-cell; vertical-align:middle;}
h1 {font-size:2em; font-weight:normal; font-family:"ProximaNova-Bold"; text-transform:uppercase; margin-bottom:1em;line-height:1.1em;}
h1 span {color:#42edb2; font-size:4.375em; line-height:1.1em;display:block; letter-spacing:1px;}
.phone_header {position: absolute; right:2em;padding-top: 1em;}
.nav_header {float: left; padding-top: 1em;}
.nav_header ul {padding-left:3.125em;}
.nav_header li { display:table-cell; text-align: center; vertical-align: bottom;font-size: .9em; font-family: "ProximaNova-Bold"; width:7em;}
.nav_header span {display:block;}
/*.section */.container {text-align:center;}
.container p {width:68.153%; line-height: 1.5625em; margin-left: auto; margin-right: auto; padding-bottom: 1em;}
a {color:#36bdf7;}
header a {text-decoration: none}
footer a {color:#2b4554}
header a, footer a span {color:#fff;}
.phone_header span, footer a, .copy  {color:#83929b}
.phone {font-weight: 600;}
ol, ul {list-style: none;}
:focus {outline: 0;}
@media only screen and (min-width : 1300px){
	header {max-width:1200px;}
}
/*@media only screen and (min-width : 768px){
	.section {padding-top:5.625em;}
}*/
@media only screen and (min-device-width : 320px) and (max-device-width : 768px) {
	.logo-link {float:none;}
	header {text-align:center;height:auto;}
	.section {padding-top: 3em;}
	h1 {font-size: 1.5em;margin-bottom:.8em;}
	h1 span {font-size:3em;}
	.container p {width:80%; margin-bottom:0;}
	.nav_header{float:right;padding-top: 0}
	.nav_header ul {padding-left:1.8em;}
	.phone_header {display:none;}
}
